import './index.css';
import Nav from './components/Navbar';
import { BrowserRouter, Routes, Route, Redirect } from 'react-router-dom'
import Footer from './components/footer';
import PrivateComponent from './components/PrivateComponent';
import AboutUs from './screen/AboutUs';
import SignUp from './screen/SignUp';
import Login from './screen/Login';
import AddVehicle from './screen/Vehicle';
import ContactUs from './screen/ContactUs';
import UserList from './screen/UserList';
import VehicleList from './screen/VehicleList';
import Home from './screen/HomePage';
import UpdateVehicle from './screen/UpdateVehicle';
// import UserComponent from './components/UserComponent';
import Dashbord from './screen/Dashbord';
import Book from './screen/Book';
function App() {
  const auth = localStorage.getItem('user');
  return (
    <div className="text-center">
      <BrowserRouter>
        <Nav />
        <Routes>

          <Route element={<PrivateComponent />}>
            <Route path='/updatevehicle/:id' element={<UpdateVehicle />} />
            <Route path='/addvehicle' element={<AddVehicle />} />
            <Route path='/userlist' element={<UserList />} />
            <Route path='/vehiclelist' element={<VehicleList />} />
          </Route>
          <Route exact path="/" element={auth ? ((JSON.parse(auth).isAdmin) ? <Redirect to="/dashboard" /> : <Redirect to="/home" />) : <Redirect to="/home" />} />
          <Route exact path="/dashboard" component={Dashbord} />
          <Route exact path="/home" component={Home} />
          <Route path='/' element={<Home />} />
          <Route path='/book/:id' element={<Book />} />
          <Route path='/signup' element={<SignUp />} />
          <Route path='/login' element={<Login />} />
          <Route path='/aboutus' element={<AboutUs />} />
          <Route path='/contactus' element={<ContactUs />} />

        </Routes>
      </BrowserRouter>
      <Footer />
    </div>
  );
}

export default App;
